import React from "react"
import { Link } from "react-router-dom/cjs/react-router-dom.min"

const ProductTableRow = (props) => {
    return (
        <tr>
            <td>{props.product.name}</td>
            <td>{props.product.category}</td>
            <td>{props.product.energyRating}</td>
            <td>{props.product.price}</td>
            <td><Link className="green-button" to="AddToCar">AddToCar</Link></td>
            {/* <td><Link className="green-button" to="EditCar">Edit</Link></td>
            <td><Link className="red-button" to="DeleteCar">Delete</Link></td> */}
        </tr>
    )
}

export default ProductTableRow
